//获取应用实例
const app = getApp()

Page({
  data: {
    StatusBar: app.globalData.StatusBar,
    CustomBar: app.globalData.CustomBar,
    hasUserInfo: false,
    isShow: false,
    title: '首页',
    tabListData: [{
      img: 'data:image/png;base64,',
      title: '我为东莞打CALL',
      btnText: '上传视频',
      color: '#ff7373',
      url: '../upload_video/index',
      showStatus: true
    }, {
      img: 'data:image/png;base64,',
      title: '婚姻登记',
      btnText: '上传照片',
      color: '#5bdc9e',
        url: '../upload_photo_editor_clip/index',
      showStatus: true
    },
    //  {
    //   img: 'data:image/png;base64,',
    //   title: '区域导览',
    //   btnText: '观看地图',
    //   color: '#ff9e93',
    //   url: '../watch_map/index',
    //   showStatus: true
    // },
    //  {
    //   img: 'data:image/png;base64,',
    //   title: '预约参观',
    //   btnText: '预约参观',
    //   color: '#ffb552',
    //   url: '../appointment/index?type=add',
    //   showStatus: true
    // }, 
    {
      img: 'data:image/png;base64,',
      title: '上传历史',
      btnText: '上传历史',
      color: '#6697ff',
      url: '../history/index',
      showStatus: true
    }]
  },
  //事件处理函数
  go(e) {
    let url = e.currentTarget.dataset.url;
    // if (url == '../upload_photo_editor_clip/index') {
    //   wx.chooseImage({
    //     count: 1,
    //     success: function(res) {
    //       wx.navigateTo({
    //         url: url + '?path=' + res.tempFilePaths[0]
    //       })
    //     },
    //   })
    // } else {
      wx.navigateTo({
        url
      })
    // }
  },
  getChildrenCode(res) {
    this.setData({
      isShow: res.detail
    })
  },
  callback(code){
    // 查看本地存储是否有token
    wx.getStorage({
      key: 'token',
      success: res => {
        // 存在
        app.globalData.token = res.data
        this.setData({
          isShow:false
        })
      },
      fail: error => {
        // 不存在,弹出授权框
        this.setData({
          isShow: true
        })
      }
    })
    wx.getStorage({
      key: 'token_type',
      success: function(res) {
        app.globalData.token_type = res.data
      },
    })
  },
  onLoad: function() {
    app.loginCallback = code => {
      this.callback(code)
    }
    if (app.globalData.userInfo) {
      this.setData({
        userInfo: app.globalData.userInfo,
        hasUserInfo: true
      })
    } else if (this.data.canIUse) {
      // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
      // 所以此处加入 callback 以防止这种情况
      app.userInfoReadyCallback = res => {
        this.setData({
          userInfo: res.userInfo,
          hasUserInfo: true
        })
      }
    } else {
      // 在没有 open-type=getUserInfo 版本的兼容处理
      wx.getUserInfo({
        success: res => {
          app.globalData.userInfo = res.userInfo
          this.setData({
            userInfo: res.userInfo,
            hasUserInfo: true
          })
        }
      })
    }
  },
  getUserInfo: function(e) {
    app.globalData.userInfo = e.detail.userInfo
    this.setData({
      userInfo: e.detail.userInfo,
      hasUserInfo: true
    })
  }
})